pragma solidity ^0.6.6;
pragma experimental ABIEncoderV2;

import "./aave/FlashLoanReceiverBase.sol";
import "./aave/ILendingPoolAddressesProvider.sol";
import "./aave/ILendingPool.sol";
import './IUniswapV2Router02.sol';

interface IKyberNetworkProxy {
    function maxGasPrice() external view returns(uint);

    function getUserCapInWei(address user) external view returns(uint);

    function getUserCapInTokenWei(address user, ERC20 token) external view returns(uint);

    function enabled() external view returns(bool);

    function info(bytes32 id) external view returns(uint);

    function getExpectedRate(ERC20 src, ERC20 dest, uint srcQty) external view returns(uint expectedRate, uint slippageRate);

    function tradeWithHint(ERC20 src, uint srcAmount, ERC20 dest, address destAddress, uint maxDestAmount, uint minConversionRate, address walletId, bytes calldata hint) external payable returns(uint);

    function swapEtherToToken(ERC20 token, uint minRate) external payable returns(uint);

    function swapTokenToEther(ERC20 token, uint tokenQty, uint minRate) external returns(uint);
}




contract Flashloan is FlashLoanReceiverBase {


     ERC20 constant internal ETH_TOKEN_ADDRESS = ERC20(0x00eeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeee);

     IKyberNetworkProxy kyber;
     IUniswapV2Router02 uniswap;
     IERC20 dai;
     address constant KYBER_ETH_ADDRESS = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
     IERC20 public projectToken;
     address public admin;
     address public daiAddress;
     address public tradedtokenAdress;

      constructor(
        address addressProvider,
        address kyberAddress,
        address uniswapAddress,
        address projectTokenAddress,
        address tradedtoken,
        address adminAddress
    ) FlashLoanReceiverBase(addressProvider)  public {

      kyber = IKyberNetworkProxy(kyberAddress);
      uniswap = IUniswapV2Router02(uniswapAddress);
      dai = ERC20(daiAddress);
      projectToken = IERC20(projectTokenAddress);
      tradedtokenAdress = tradedtoken;
      admin = adminAddress;

    }

    bool arbdir;


    function getTradedTokenAddress() public view returns(address owner){

        return tradedtokenAdress;
    }


    function getOwnerAddress() public view returns(address owner){

        return admin;
    }

    function getDaiBalance() public view returns(uint256 balance){

       ERC20 theTokenk = ERC20(tradedtokenAdress);
       uint256 balanceDai = theTokenk.balanceOf(address(this));

        return balanceDai;
    }

    function getEthBalance() public view returns(uint256 balance){
        uint256 ethbalance = address(this).balance;

        return ethbalance;
    }




    function flashloan(uint amou) public {

     // require(projectToken.balanceOf(msg.sender) >= 50 * 1e18, 'insufficient balance');
       // address receiver = address(this); // Can also be a separate contract

        uint256 amount = amou;

        bytes memory params = "";

        arbdir = true; 

        ILendingPool lendingPool = ILendingPool(addressesProvider.getLendingPool());

        lendingPool.flashLoan(address(this), tradedtokenAdress, amount, params);

    }

    function flashloan2( uint amou) public {

    //  require(projectToken.balanceOf(msg.sender) >= 50 * 1e18, 'insufficient balance');
       // address receiver = address(this); // Can also be a separate contract

        uint256 amount = amou;

         bytes memory params = "";

         arbdir == false;

        ILendingPool lendingPool = ILendingPool(addressesProvider.getLendingPool());

        lendingPool.flashLoan(address(this), tradedtokenAdress, amount, params);

    }

    function executeOperation(
        address _reserve,
        uint256 _amount,
        uint256 _fee,
        bytes calldata _params
    )
        external
        override
    {


   //  require(_amount => getBalanceInternal(address(this), _reserve), "Invalid balance, not enough dai to pay the fee, was the flashLoan successful?");

        ERC20 theTokenk = ERC20(_reserve);

        uint256 balanceDai = theTokenk.balanceOf(address(this));

        if(arbdir) {

         theTokenk.approve(address(uniswap),balanceDai);

          address[] memory path = new address[](2);
          path[0] = address(theTokenk); // kovan address(0xFf795577d9AC8bD7D90Ee22b6C1703490b6512FD); 
          path[1] = uniswap.WETH();


          uint[] memory minOuts = uniswap.getAmountsOut(balanceDai, path); 

              uniswap.swapExactTokensForETH(
                balanceDai,
                minOuts[1], 
                path, 
                address(this), 
                now
              );


             (uint expectedRate,)  = kyber.getExpectedRate(
              ERC20(uniswap.WETH()), 
              theTokenk, 
              address(this).balance
             );

//value:expectedRate

            kyber.swapEtherToToken.value(address(this).balance)(
            theTokenk, 
            expectedRate
          );



        } else {

            theTokenk.approve(address(kyber), _amount); 
         //   theTokenk.approve(address(uniswap),_amount);

            (uint expectedRate,) = kyber.getExpectedRate(
                theTokenk, 
                ERC20(KYBER_ETH_ADDRESS),
                _amount
              );

             kyber.swapTokenToEther(theTokenk, _amount, expectedRate);


             address[] memory path2 = new address[](2);
             path2[0] = uniswap.WETH();
             path2[1] = address(theTokenk);


              uint[] memory minOuts2 = uniswap.getAmountsOut(address(this).balance, path2); 

              uniswap.swapETHForExactTokens.value(address(this).balance)(
              minOuts2[1], 
              path2, 
              address(this), 
              now
            );


        }


        uint totalDebt =  _amount.add(_fee);
        transferFundsBackToPoolInternal(_reserve, totalDebt);
      // theTokenk.transfer(addressesProvider.getLendingPool(),totalDebt);
    }



    function withdrawETHAndTokens() external onlyOwner {

         msg.sender.send(address(this).balance);
         ERC20 daiToken = ERC20(tradedtokenAdress);
         uint256 currentTokenBalance = daiToken.balanceOf(address(this));
        daiToken.transfer(msg.sender, currentTokenBalance);

    }

}
